import React from "react";
import Cardite from "./Cardite";

const Card = () => {
  return (
    <>
      <div style={{ display: "flex", justifyContent: "space-around" }}>
        <Cardite />
        <Cardite />
        <Cardite />
      </div>
    </>
  );
};

export default Card;
